import { Component } from 'react';
import { Link } from 'react-router-dom';


class Home extends Component {
  constructor(props) {
    super(props);
    this.state = {
      email: '',
      password: '',
    }
  }

  render() {
    return (
    <div className="homeContainer">
      <Link to="/login">Login</Link>
			<Link to="/cadastro">Cadastro</Link>
    </div>);
  }
}




export default Home;
